import { Routes } from "react-router-dom";

const AppRoutes = () => {
return (
    <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<SingUp />} />
    </Routes>
);

}

export default AppRoutes;
